import React from 'react';
import logo from './logo.svg';
import poll from './Event'
import test from "./test-assignment"
import './App.css';

function App() {



  return (
    <div className="App">
        {sportEvent()}
    </div>



  );
}

function sportEvent() {
    let value=JSON.parse(JSON.stringify(test));
    let sportEvent=document.querySelector("#App");
    for(let data of value){
        sportEvent.innerHTML+=data;
    }
}

export default App;
